import React from "react";
import $ from "jquery";
require("jsgrid");

const AdmProductGrid = () => {
  window.jQuery = require("jquery");
  this.gridRef = React.createRef();
  window.jQuery(this.gridRef.current).jsGrid({
    width: "100%",
    height: "400px",

    filtering: true,
    editing: true,
    sorting: true,
    paging: true,

    fields: [
      { name: "Name", type: "text", width: 150 },
      { name: "Age", type: "number", width: 50 },
      { name: "Address", type: "text", width: 200 },
      {
        name: "Country",
        type: "select",
        items: 0,
        valueField: "Id",
        textField: "Name",
      },
      {
        name: "Married",
        type: "checkbox",
        title: "Is Married",
        sorting: false,
      },
      { type: "control" },
    ],
  });

  return <div id="jsGrid" ref={this.gridRef} />;
};

export default AdmProductGrid;
